import React, { useState } from 'react';

function Pc() {
  const [pcData, setPcData] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const baseUrl = process.env.REACT_APP_URL;




  const fetchData = async () => {
    setIsLoading(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:4300/get-pc');
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const data = await response.json();
      setPcData(data);
    } catch (error) {
      setError('Failed to fetch data: ' + error.message);
    }
    setIsLoading(false);
  };

  return (
    <div>
      <button onClick={fetchData} disabled={isLoading}>
        {isLoading ? 'Loading...' : 'Get PC Data'}
      </button>
      {error && <div style={{ color: 'red' }}>{error}</div>}
      <ul>
        {pcData.map(item => (
          <li key={item._id}>
            <strong>PC Name:</strong> {item.pcname}, 
            <strong> Start Time:</strong> {item.starttime},
            <strong> Last Time:</strong> {item.lasttime},
            <strong> Total Time:</strong> {item.totaltime}s,
            <strong> School:</strong> {item.schoolname},
            <strong> Lab Number:</strong> {item.labnum},
            <strong> PC Number:</strong> {item.pcnum}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Pc;
